article_content:
애기 물건들 보관하려고 구매했어요. 아기사진, 탯줄 등등 보관할게 많더라구요. 근데 마땅히 보관할 곳도 없고..
요즘에는 탯줄보관함?보관박스?라 해서 예쁜 디자인으로 제작할 수 있다고는 하는데 너무 비싸고 사이즈가 저에게는 너무 작더라구요. 그리고 쓸데없이 배냇머리, 배냇손톱, 배냇치아 등등... 버려야 마땅할 것들이라 생각했는데 보관하라 하더라고요.ㅋㅋㅋ 보관할 수 있는 자리가 있다는...;;;;

이것저것 따지다가 요 박스 발견하고 구매했는데 유레카입니다. 디자인도 깔끔하니 괜찮고 제가 딱 원하던 사이즈라 이것저것 다 들어갑니다. 한 곳에 다 넣으니 여기저기서 찾을 필요도 없고 좋습니다. 다만, a3사이즈 액자는 대자에 들어가지 않네요. 들어가긴 하는데 뚜껑을 꽉 닫지는 못하는 좀 애매한 사이즈입니다. 좀 더 큰사이즈살걸 조금 후회했지만 너무나도 깔끔한 디자인을 좋은 가격에 잘 산 것 같습니다. 나중에 아기가 좀 큰 다음에 넘겨줄게요.^^
